import React from "react";
import { useNavigate } from "react-router-dom";
import Header from "../components/Header/Header";

function Community() {
  return (
    <div>
      <Header />
      <div>Community</div>
      <button
        onClick={() => {
          navigate("/community_edit");
        }}
      ></button>
      <button>챌린지 생성하기</button>
    </div>
  );
}

export default Community;
